dirFile.eachFileRecurse {f->
    if (f.name.startsWith('CD')||f.name.startsWith('ID')) {
        f.absolutePath.eachMatch(/\/(v201[0-9]+)\//) {s0,String kmehrVersion ->
            if (!kmehrVersion?.length()) { return }
            if (['CDCONTENTschemes.java','CDTRANSACTIONschemes.java','CDITEMschemes.java','CDHCPARTYschemes.java',
                 'CDHCPARTYschemes.java','CDADDRESSschemes.java','CDTELECOMschemes.java','CDTIMEUNITschemes.java',
                 'CDCOUNTRYschemes.java','CDINNCLUSTERschemes.java','CDDRUGCNKschemes.java','CDUNITschemes.java'].contains(f.name)) {
                def text = f.text.replaceAll("    ([a-zA-Z0-9_]+?)\\(\"([a-zA-Z0-9_-]+?)\"\\)([,;])\n") {
                    "    ${it[1]}(\"${it[2]}\", \"${versions[it[2].replaceAll("[_-]","")]?.get(kmehrVersion)?:'1.0'}\")${it[3]}\n"
                }.replace(
                        "    private final String value;\n",
                        "    private final String value; //\n" +
                        "    private final String version;"
                ).replace(
                        "    public String value() {\n" +
                        "        return value;\n" +
                        "    }\n",
                        "    public String value() {\n" +
                        "        return value;\n" +
                        "    } //\n" +
                        "\n" +
                        "    public String version() {\n" +
                        "        return version;\n" +
                        "    }\n"
                ).replaceAll(
                        "    CD(.+?)schemes\\(String v\\) \\{\n" +
                        "        value = v;",
                        "    CD\$1schemes(String v, String vs) {\n" +
                        "        value = v;\n" +
                        "        version = vs;"
                )
                f.write(text)
            } else {
                def consts = [:]
                def reqs = []

                def text = f.text
                text.eachMatch(/name="(.+?)" use="required" type="\{http:\/\/www.w3.org\/2001\/XMLSchema\}string" fixed="(.+?)"/) { s00, s01, s02 ->
                    consts[s01] = s02
                }
                text.eachMatch(/name="(.+?)" use="required"/) { s00, s01 ->
                    reqs << s01
                }
                if (consts['S']?.length()) {
                    consts['SV'] = versions[(consts['S'] as String).replaceAll('[-_]', '')]?.get(kmehrVersion)?:'1.0'
                } else {
                    consts['SV'] = '1.0'
                }
                reqs.each {
                    String replacement = consts[it]
                    if (replacement?.length()) {
                        text = text.replaceAll(
                                "@XmlAttribute\\(name = \"($it)\", required = true\\)\n" +
                                        "    protected String ([a-z_][A-Za-z_]*?);",
                                '@XmlAttribute(name = "$1", required = true)\n' +
                                        '    protected String $2 = "'+replacement+'";')
                    }
                }
                f.write(text)
            }
        }
    }
